import ReactDOM from 'react-dom';
import App from './App';
import axios from 'axios';

axios
  .get('http://localhost:3001/persons')
  .then(persons => {
    ReactDOM.render(
      <App personData={persons.data}/>,
      document.getElementById('root')
    );
  });
